dMoney_Free&quot;, &quot;SneakPeek_SendMoney_Unilateral&quot;, &quot;SneakPeek_SendMoney_Simple&quot;]" data-bg-img=""><div class="emModuleContent"><div class="mpiBannerContainer js_mpiBannerContainer transferBanner"><div class="row"><div class="col-xs-4 transferActionColumns"><a href="#" target="_top" class="nemo_primaryActionButton_transferBuy transferPrimaryActions" name="EM_BUY_CTA" data-pagename="main:walletweb:transfer:buy:start" data-pagename2="main:walletweb:transfer:buy:start:::" data-track-type="link"><span class="icon icon-register engagementAction-icon_transferDesktop" aria-hidden="true"></span><span class="transferPrimaryActionContent vx_h3">Pay for goods or services</span></a><p class="transferPrimaryActionBody"><span class="icon icon-shield engagementAction-icon_transfer-shield" aria-hidden="true"></span>Covered by <a href="/us/webapps/mpp/paypal-safety-and-security" target="_blank" class="transferSecondaryActionText nemo_secondaryAction_transferPurchaseProtection" name="emOfferTransferBuySecondaryAction" data-pagename="main:consumer:summary::main" data-pagename2="main:consumer:summary::main:::" data-track-type="link">PayPal Protection for buyers</a>.<br>No fee for you. The seller pays a fee.</p></div><div class="col-xs-4 transferActionColumns"><a href="#" target="_top" class="nemo_primaryActionButton_transferSend transferPrimaryActions" name="EM_Send_CTA" data-pagename="main:walletweb:transfer:send:start" data-pagename2="main:walletweb:transfer:send:start:::" data-track-type="link"><span class="icon icon-send-money engagementAction-icon_transferDesktop" aria-hidden="true"></span><span class="transferPrimaryActionContent vx_h3">Send to friends and family in the US</span></a><p class="transferPrimaryActionBody">It’s free when you use bank or balance.</p></div><div class="col-xs-4 transferActionColumns"><a href="#" target="_top" class="nemo_primaryActionButton_transferXB transferPrimaryActions" name="EM_XB_CTA" data-pagename="main:walletweb:transfer:xb: